import CardButton from '../../components/card-button';

const Profile = () => {
  const { data } = useContext(GlobalContext);
  console.log(data);
  return (
    <div className='profile center-items'>
      <CardButton imgSrc={ProfilePic} />
      <Card title='Aviran Levi' />
    </div>
  );
};
export default Profile;
